function ClearGame () {
    IsClearing = true
    for (let value of sprites.allOfKind(SpriteKind.Player)) {
        sprites.destroy(value)
    }
    for (let value of sprites.allOfKind(SpriteKind.Projectile)) {
        sprites.destroy(value)
    }
    for (let value of sprites.allOfKind(SpriteKind.EProjectile)) {
        sprites.destroy(value)
    }
    for (let value of sprites.allOfKind(SpriteKind.Enemy)) {
        sprites.destroy(value)
    }
    for (let value of sprites.allOfKind(SpriteKind.StatusBar)) {
        sprites.destroy(value)
    }
    for (let value of sprites.allOfKind(SpriteKind.SlashHB)) {
        sprites.destroy(value)
    }
    for (let value of sprites.allOfKind(SpriteKind.DSlashHB)) {
        sprites.destroy(value)
    }
    for (let value of sprites.allOfKind(SpriteKind.Food)) {
        sprites.destroy(value)
    }
    for (let value of sprites.allOfKind(SpriteKind.Tut1)) {
        sprites.destroy(value)
    }
    for (let value of sprites.allOfKind(SpriteKind.Tut2)) {
        sprites.destroy(value)
    }
    for (let value of sprites.allOfKind(SpriteKind.Tut3)) {
        sprites.destroy(value)
    }
    for (let value of sprites.allOfKind(SpriteKind.Tut4)) {
        sprites.destroy(value)
    }
    for (let value of sprites.allOfKind(SpriteKind.Tut5)) {
        sprites.destroy(value)
    }
    for (let value of sprites.allOfKind(SpriteKind.Tut6)) {
        sprites.destroy(value)
    }
    IsClearing = false
}
