function ResetLevel (Level: number) {
    ClearGame()
    if (Level == 0) {
        LoadTutorial()
    } else if (Level == 1) {
        game.showLongText("Hint: Don't take damage for 8 seconds to heal", DialogLayout.Bottom)
        LoadLevel1()
    } else if (Level == 2) {
        game.showLongText("Hint: You can break enemy projectile", DialogLayout.Bottom)
        LoadLevel2()
    } else if (Level == 3) {
        LoadLevel3()
    } else if (Level == 4) {
        LoadLevel4()
    }
}
function LinkToNextLevel (Level: number) {
    ClearGame()
    if (Level == 0) {
        LoadStory1()
    } else if (Level == 1) {
        LoadStory2()
    } else if (Level == 2) {
        LoadStory3()
    } else if (Level == 3) {
        LoadStory4()
    } else {
        game.gameOver(true)
    }
}
function JohnGreenDeath (mySprite: Sprite) {
    if (JGDDB == true) {
        JGDDB = false
        scene.cameraShake(8, 5000)
        aiEnemy.setFlag(SpriteFlag.GhostThroughSprites, true)
        DeathEffect = extraEffects.createCustomSpreadEffectData(
        [
        9,
        3,
        10,
        5,
        12
        ],
        false,
        extraEffects.createPresetSizeTable(ExtraEffectPresetShape.Explosion),
        extraEffects.createPercentageRange(50, 100),
        extraEffects.createPercentageRange(50, 100),
        extraEffects.createTimeRange(1000, 2000),
        randint(100, -100),
        randint(100, -100),
        extraEffects.createPercentageRange(50, 100),
        0,
        0,
        200
        )
        extraEffects.createSpreadEffectOnAnchor(aiEnemy, DeathEffect, 5000, 100, 37)
        JGCAttacl = false
        timer.after(4000, function () {
            music.stopAllSounds()
            sprites.destroy(JGHB)
            John_fart_3 = sprites.create(assets.image`John fart`, SpriteKind.Food)
            scene.cameraFollowSprite(John_fart_3)
            tiles.placeOnTile(John_fart_3, tiles.getTileLocation(50, 28))
            if (John_fart_3.x > aiEnemy.x + 40) {
                spriteutils.moveTo(John_fart_3, spriteutils.pos(aiEnemy.x + 40, John_fart_3.y), 2000)
            }
            timer.after(2500, function () {
                Dialouge("What happened while i was on the toilet?! WAIT. MY HOLOGRAM BECAME SENTIENT?! OMG! well... i'm, going to feel bad but... delete!", "abc", "abc", mySprite, DImage8, true)
                sprites.destroy(aiEnemy)
                Dialouge("John Green?! YOUR'E BACK!!!!", "abc", "abc", mySprite, DImage7, true)
                music.setVolume(35)
                endgame()
            })
        })
    }
}
