sprites.onOverlap(SpriteKind.Enemy, SpriteKind.SlashHB, function (sprite, otherSprite) {
    sprite.setFlag(SpriteFlag.GhostThroughSprites, true)
    sprites.changeDataNumberBy(sprite, "health", -5)
    console.log(sprites.readDataNumber(sprite, "health"))
    music.play(music.createSoundEffect(WaveShape.Noise, 627, 188, 255, 0, 100, SoundExpressionEffect.Warble, InterpolationCurve.Logarithmic), music.PlaybackMode.UntilDone)
    scene.cameraShake(2, 200)
    if (sprites.readDataNumber(sprite, "Type") == 4) {
        if (sprites.readDataNumber(sprite, "health") <= 0 && sprites.readDataNumber(sprite, "Phase") == 1) {
            Phase2Switch(sprite)
        } else if (sprites.readDataNumber(sprite, "health") <= 0 && sprites.readDataNumber(sprite, "Phase") != 1) {
            JohnGreenDeath(mySprite)
        }
    } else if (sprites.readDataNumber(sprite, "health") <= 0) {
        sprites.destroy(sprite)
        CheckDefeatedEnemies()
    }
    extraEffects.createSpreadEffectOnAnchor(sprite, E2, 100, 20)
    timer.after(500, function () {
        sprite.setFlag(SpriteFlag.GhostThroughSprites, false)
    })
})
function ChangeColorPalette (Palate: number) {
    if (Palate == 1) {
        // Keep this white unless really needed to change
        color.setColor(1, color.rgb(255, 247, 228))
        color.setColor(2, color.rgb(255, 167, 202))
        color.setColor(3, color.rgb(252, 0, 35))
        color.setColor(4, color.rgb(255, 128, 2))
        color.setColor(5, color.rgb(255, 221, 13))
        color.setColor(6, color.rgb(0, 145, 4))
        color.setColor(7, color.rgb(0, 14, 197))
        color.setColor(8, color.rgb(96, 0, 146))
        color.setColor(9, color.rgb(147, 227, 253))
        color.setColor(10, color.rgb(150, 211, 95))
        color.setColor(11, color.rgb(71, 71, 71))
        color.setColor(12, color.rgb(238, 113, 158))
        color.setColor(13, color.rgb(255, 193, 155))
        color.setColor(14, color.rgb(255, 183, 136))
        color.setColor(15, color.rgb(0, 0, 0))
    }
    if (Palate == 2) {
        // Keep this white unless really needed to change
        color.setColor(1, color.rgb(255, 247, 228))
        color.setColor(2, color.rgb(255, 167, 202))
        // Orange (lighter)
        color.setColor(3, color.rgb(123, 97, 62))
        // Red(Darker)
        color.setColor(4, color.rgb(104, 83, 56))
        color.setColor(5, color.rgb(255, 221, 13))
        color.setColor(6, color.rgb(0, 145, 4))
        color.setColor(7, color.rgb(0, 14, 197))
        color.setColor(8, color.rgb(96, 0, 146))
        color.setColor(10, color.rgb(150, 211, 95))
        color.setColor(11, color.rgb(71, 71, 71))
        color.setColor(12, color.rgb(238, 113, 158))
        color.setColor(13, color.rgb(255, 193, 155))
        color.setColor(14, color.rgb(255, 183, 136))
        color.setColor(15, color.rgb(0, 0, 0))
    }
}
