sprites.onOverlap(SpriteKind.Enemy, SpriteKind.DSlashHB, function (sprite, otherSprite) {
    sprite.setFlag(SpriteFlag.GhostThroughSprites, true)
    Codey.vy = -250
    sprites.changeDataNumberBy(sprite, "health", -5)
    scene.cameraShake(2, 200)
    music.play(music.createSoundEffect(
    WaveShape.Noise,
    randint(650, 700),
    randint(150, 250),
    255,
    0,
    100,
    SoundExpressionEffect.Warble,
    InterpolationCurve.Logarithmic
    ), music.PlaybackMode.InBackground)
    if (sprites.readDataNumber(sprite, "Type") == 4) {
        if (sprites.readDataNumber(sprite, "health") <= 0 && sprites.readDataNumber(sprite, "Phase") == 1) {
            Phase2Switch(sprite)
        } else if (sprites.readDataNumber(sprite, "health") <= 0 && sprites.readDataNumber(sprite, "Phase") != 1) {
            JohnGreenDeath(mySprite)
        }
    } else if (sprites.readDataNumber(sprite, "health") <= 0) {
        sprites.destroy(sprite)
        CheckDefeatedEnemies()
    }
    extraEffects.createSpreadEffectOnAnchor(sprite, E2, 100, 20)
    timer.after(300, function () {
        sprite.setFlag(SpriteFlag.GhostThroughSprites, false)
    })
})
sprites.onOverlap(SpriteKind.Player, SpriteKind.Tut2, function (sprite, otherSprite) {
    otherSprite.sayText("Press B on the controller or X on the keyboard to Attack me to destroy this wall!", 1000, false)
})
