browserEvents.F.onEvent(browserEvents.KeyEvent.Pressed, function () {
    if (LevelType == "2d") {
        if (!(controller.left.isPressed() || controller.right.isPressed())) {
            if (i == true) {
                Shuriken()
                i = false
                timer.after(ShurikenCD, function () {
                    i = true
                })
            }
        } else {
            if (SlashDB == true) {
                console.log(SlashDB)
                music.play(music.createSoundEffect(WaveShape.Noise, 1592, 1, 255, 255, 200, SoundExpressionEffect.None, InterpolationCurve.Curve), music.PlaybackMode.InBackground)
                SlashDB = false
                if (controller.left.isPressed()) {
                    LeftSlashAttack()
                } else if (controller.right.isPressed()) {
                    RightSlashAttack()
                } else {
                	
                }
                timer.after(SlashCD, function () {
                    music.play(music.createSoundEffect(WaveShape.Sine, 1154, 5000, 76, 0, 200, SoundExpressionEffect.Warble, InterpolationCurve.Curve), music.PlaybackMode.InBackground)
                    SlashDB = true
                })
            }
        }
    }
})
