function CreateEnemy (SpawnLocation: tiles.Location, Image2: Image, Damage: number, Health: number, Range: number, AttackCD: number, RRange: number, Type: number) {
    aiEnemy = sprites.create(Image2, SpriteKind.Enemy)
    tiles.placeOnTile(aiEnemy, SpawnLocation)
    sprites.setDataNumber(aiEnemy, "health", Health)
    sprites.setDataBoolean(aiEnemy, "EAttackDB", true)
    sprites.setDataNumber(aiEnemy, "EAttackRange", Range)
    sprites.setDataNumber(aiEnemy, "RRange", Range)
    sprites.setDataNumber(aiEnemy, "Type", Type)
    sprites.setDataNumber(aiEnemy, "EAttackCD", AttackCD)
    aiEnemy.y += -5
    aiEnemy.ay = 600
}
