function SetUpHealthBar () {
    CodyHB = statusbars.create(40, 8, StatusBarKind.Health)
    CodyHB.max = MaxHealth
    CodyHB.max = MaxHealth
    CodyHB.setColor(10, 11, 5)
    CodyHB.setBarBorder(1, 15)
    CodyHB.positionDirection(CollisionDirection.Left)
    CodyHB.setLabel("HP")
    CodyHB.setOffsetPadding(-50, 5)
}
sprites.onOverlap(SpriteKind.Player, SpriteKind.Tut4, function (sprite, otherSprite) {
    otherSprite.sayText("Press F on your keyboard to use your special attack! (PC only)", 2000, false)
    timer.after(2000, function () {
        otherSprite.sayText("Try while moving as well!", 2000, false)
        timer.after(2000, function () {
            otherSprite.sayText("if not on pc, parkour over", 1000, false)
        })
    })
})
scene.onOverlapTile(SpriteKind.Player, sprites.dungeon.collectibleInsignia, function (sprite, location) {
    if (CurrentLevel == 0) {
        LinkToNextLevel(0)
    } else if (CurrentLevel == 1) {
        LinkToNextLevel(1)
    } else if (CurrentLevel == 2) {
        LinkToNextLevel(2)
    } else if (CurrentLevel == 3) {
        LinkToNextLevel(3)
    }
})
sprites.onOverlap(SpriteKind.Player, SpriteKind.Enemy, function (sprite, otherSprite) {
    CodyHB.value += -10
    CodyHealth += -10
    HealingTime = 8
    HealDB = false
    scene.cameraShake(5, 200)
    music.play(music.createSoundEffect(WaveShape.Sawtooth, 481, 1, 255, 0, 200, SoundExpressionEffect.Vibrato, InterpolationCurve.Curve), music.PlaybackMode.InBackground)
    timer.after(500, function () {
    	
    })
    sprite.setFlag(SpriteFlag.GhostThroughSprites, true)
    extraEffects.createSpreadEffectOnAnchor(sprite, extraEffects.createSingleColorSpreadEffectData(5, ExtraEffectPresetShape.Spark), 100, 20, 20)
    timer.after(750, function () {
        sprite.setFlag(SpriteFlag.GhostThroughSprites, false)
    })
    if (CodyHealth <= 0) {
        music.stopAllSounds()
        music.play(music.createSoundEffect(WaveShape.Square, 1242, 1, 98, 0, 1500, SoundExpressionEffect.Vibrato, InterpolationCurve.Curve), music.PlaybackMode.InBackground)
        game.showLongText("You Died! Try Again?", DialogLayout.Bottom)
        ClearGame()
        ResetLevel(CurrentLevel)
    }
})
