game.onUpdateInterval(1000, function () {
    if (HealingTime > 0) {
        HealingTime += -1
    } else if (HealingTime == 0) {
        HealDB = true
    }
})
forever(function () {
    if (sprites.allOfKind(SpriteKind.Enemy).length > 0) {
        for (let value of sprites.allOfKind(SpriteKind.Enemy)) {
            if (sprites.readDataNumber(value, "Type") == 4) {
                JGHB.value = sprites.readDataNumber(value, "health")
            }
        }
    }
})
forever(function () {
    if (DBSlash) {
        DBSlash.setPosition(Codey.x, Codey.y + 8)
    }
    if (RBSlash) {
        RBSlash.setPosition(Codey.x + 5, Codey.y + 0)
    }
    if (LBSlash) {
        LBSlash.setPosition(Codey.x - 5, Codey.y + 0)
    }
    if (UBSlash) {
        UBSlash.setPosition(Codey.x, Codey.y - 12)
    }
})
forever(function () {
    if (CurrentLevel == 4) {
        if (Codey.x >= 288) {
            if (JGBStarted == false) {
                JGBStarted = true
                scene.cameraShake(8, 2000)
                JGEPL = []
                JGPortalList = []
                timer.after(2000, function () {
                    EImage = assets.image`JGP`
                    JGL = tiles.getTileLocation(33, 28)
                    CreateEnemy(JGL, EImage, 12, 100, 200, 1500, 32, 4)
                    sprites.setDataNumber(aiEnemy, "Phase", 1)
                    aiEnemy.ay = 0
                    JGHB = statusbars.create(120, 10, StatusBarKind.EnemyHealth)
                    JGHB.setStatusBarFlag(StatusBarFlag.SmoothTransition, true)
                    JGHB.max = 100
                    JGHB.setColor(8, 11, 5)
                    JGHB.setBarBorder(2, 15)
                    JGHB.positionDirection(CollisionDirection.Bottom)
                    JGHB.setOffsetPadding(0, 5)
                    JGCAttacl = true
                })
            }
        }
    }
})
